import React, { Component } from 'react';
import {CardBody,CardText} from 'reactstrap';
class Card extends Component{
        render (){
          
                return (
                        <ul class="list-group">
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                        {this.props.notes}
                        
                        </li>
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                      
                        {this.props.notes}
                        </li>
                        <li class="list-group-item d-flex justify-content-between align-items-center">
                        {this.props.notes}
                       
                        </li>
                        </ul>
                
        
                );
        }
}
export default Card;
